import React from 'react';
import {render} from 'react-dom';
import App from './components/App';






fetch('https://dog.ceo/api/breeds/list/all')
.then(response => {
    return response.text()
 })                
.then(text => {
    console.log(text);
    render(<App URL={text.messege}/>, document.getElementById('root'));
});
